(2285,	196,	'texto_radar',	'A empresa MEDTEC trabalha fornecendo placas, módulos, válvulas e peças de uma forma geral importando com os principais fabricantes. Atuamos no mercado nos modelos de Radar de Defesa, Radar de Controle, Radar Meteorológico, Radar de Busca, Radar Banda C, Radar Secundário, Radar Transportável, Giga de Testes, Simuladores, Contra Medidas, atendendo as Forças Armadas, Prefeitura e Governo do Estado. Realizamos manutenção, atualização tecnológica, contratos de serviços.'),
(2286,	196,	'_texto_radar',	'field_5cfe7e218be13'),
(2287,	196,	'texto_sec',	'A empresa MEDTEC trabalha fornecendo Placas, Módulos, Câmeras, Speed Dome, DVR, cabos, Drone Sistemas, Sistemas de extinção de incêndio, fibra ótica e peças de uma forma geral importando com os principais fabricantes. Realizamos manutenção, atualização tecnológica, contratos de serviços.'),
(2288,	196,	'_texto_sec',	'field_5cfe7e218be66'),
(2289,	196,	'texto_met',	'A empresa MEDTEC trabalha fornecendo Placas, Módulos, Estações Meteorológicas, Medidores de vento, Medidores de pressão, Medidores de umidade, Medidores de temperatura, Sistemas, e peças de uma forma geral importando com os principais fabricantes. Realizamos ajustes e calibração em instrumentos de medidas.'),
(2290,	196,	'_texto_met',	'field_5cfe7e218beba'),
(2291,	196,	'texto_tele',	'A empresa MEDTEC trabalha fornecendo Placas, Módulos, Roteadores, Switch, Servidores, Sistemas, fibra ótica e peças de uma forma geral importando com os principais fabricantes.'),
(2292,	196,	'_texto_tele',	'field_5cfe7e218bf11'),
(2293,	196,	'texto_ener',	'A  empresa MEDTEC trabalha fornecendo Placas, Módulos, Led, Placas Solares, Sistemas, Inversores, Baterias e peças de uma forma geral importando com os principais fabricantes. Desenvolvemos projetos específicos de diminuição de consumo de energia minimizando gastos nas empresas. Realizamos manutenção, atualização tecnológica, contratos de serviços.'),
(2294,	196,	'_texto_ener',	'field_5cfe7e218bf60'),
(2295,	196,	'texto_bio',	'A empresa MEDTEC trabalha fornecendo Placas, Módulos, Sistemas, e peças de uma forma geral importando com os principais fabricantes. Realizamos manutenção em equipamentos biomédicos atendendo os principais hospitais e postos de saúde do Rio de Janeiro.'),
(2296,	196,	'_texto_bio',	'field_5cfe7e218c04e'),
